$(document).ready(function(){if($("#rickshaw-realtime").length!=0){(function(){var a="#rickshaw-realtime";var c=[[],[],[]];var f=new Rickshaw.Fixtures.RandomData(50);for(var b=0;b<50;b++){f.addData(c)}var g=new Rickshaw.Graph({element:document.querySelector(a),height:338,renderer:"area",padding:{top:0.4},series:[{data:c[0],color:"rgba(74, 169, 233, 0.6)",name:"Server 1"},{data:c[1],color:"rgba(0,0,0,.06)",name:"Server 2"}]});var e=new Rickshaw.Graph.Axis.Y({graph:g,orientation:"right",tickFormat:Rickshaw.Fixtures.Number.formatKMBT,element:document.getElementById("rickshaw-realtime_y_axis")});var d=new Rickshaw.Graph.HoverDetail({graph:g});setInterval(function(){f.removeData(c);f.addData(c);g.update()},1000);d3.selectAll("#rickshaw-realtime_y_axis .tick.major line").attr("x2","9");d3.selectAll("#rickshaw-realtime_y_axis .tick.major text").attr("x","14");$(window).resize(function(){g.configure({width:$(a).width(),height:338});g.render()});$(a).data("chart",g)})()}if($("#rickshaw-stacked-bars").length!=0){(function(){var a="#rickshaw-stacked-bars";var c=[[],[]];var e=new Rickshaw.Fixtures.RandomData(50);for(var b=0;b<50;b++){e.addData(c)}var f=new Rickshaw.Graph({renderer:"bar",element:document.querySelector(a),height:400,padding:{top:0.4},series:[{data:c[0],color:"rgba(74, 169, 233, 0.9)",name:"New users"},{data:c[1],color:"rgba(0, 0, 0, 0.1)",name:"Returning users"}]});var d=new Rickshaw.Graph.HoverDetail({graph:f,formatter:function(i,g,l){var h='<span class="date">'+new Date(g*1000).toUTCString()+"</span>";var j='<span class="detail_swatch" style="background-color: '+i.color+'"></span>';var k=j+i.name+": "+parseInt(l)+"<br>"+h;return k}});f.render();$(window).resize(function(){f.configure({width:$(a).width(),height:400});f.render()});$(a).data("chart",f)})()}});